{"id":21850,"labels":["Actor","Director","Person"],"properties":{"birthplace":"Reims","name":"Stéphan Guérin-Tillié","lastModified":"1301901469000","id":"38450","biography":"Stéphan Guérin-Tillié est né à Reims. Il a passé une partie de son enfance à Aurillac dans le Cantal. Suite à sa rencontre avec Pierre Romans (metteur en scène), il entre au cours Florent et travaille avec Raymond Acquaviva et Isabelle Nanty.

Il fait ses premiers pas au théâtre sous la direction de Françoise Petit et de Thierry de Peretti. Les rôles à la télévision et au cinéma vont ensuite se succéder.

